import React, { Fragment } from 'react'
import Button from '../../common/button'

export default class SuccessEditTagEmployee extends React.Component{
    constructor(props){
        super(props);
        this.state={

        }
    }

    onCancelClick = () => {
        this.props.data.callback();
        this.props.onCancelClick();
    }

    render(){
        return(
          <Fragment>
                <div style={styles.TitleModal} >
                    Thay đổi thông tin sử dụng thẻ của nhân viên
                </div>
                <div style= {styles.styleContent}>
                    <h2>
                    Thay đổi thông tin sử dụng thẻ của nhân viên thành công

                    </h2>
                </div>
                <div style={styles.GroupButton}>
                    <Button onClick={this.onCancelClick}
                    title={'Hoàn thành'}/>
                </div>

          </Fragment>
        )
    }
}

const styles ={
    styleContent: {
    width: 'auto',
    textAlign: 'center',
    overflow: 'hidden',
    display: 'block',
    },
    TitleModal: {
        fontSize: '21px',
        fontWeight: 600,
        color: 'rgb(227, 6, 19)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        height: '30px',
        paddingTop: '25px',
        paddingBottom: '15px',
        textAlign: 'center'
    },
    GroupButton: {
        marginTop: '50px',
        height: '70px',
        borderTop: '1px solid red',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
    },
}
